import styled from 'styled-components';

export const ProfileContainer = styled.section`
  background: red;
  width: 1423px;
  box-sizing: border-box;
`;

export const ProfileHeader = styled.div`
  background: blue;

  margin: 0 auto;

  h1 {
    color: white;
  }
`;
